        <br/>        
        <br/>        
        <br/>        
        <WhyChooseUs />
        <Sales />
        <TeamOne />
        <div className="area-bg">
          <Roadmap />
        </div>
      </main>
    </LayoutOne>
  );
};

export default Home;
